import React from 'react';

type imageProp = {
    tracker: trackerType
    image?: any
}

export type trackerType = {
    x?: number
    y?: number
}

const Image: React.FC<imageProp> = (props) => {
    const {tracker} = props;
    return <><ImageWrapper src={props.image} style={{position: 'absolute', left: tracker.x, top: tracker.y}}/></>
};

Image.defaultProps ={
    image: "/src/images/cat.png"
};

export default Image;
